import React, { Component } from "react";
import {
  BrowserRouter as Router,
  Route
} from 'react-router-dom';
import HomePage from "./pages/HomePage.js";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="App">
        <Route path="/" component={HomePage}/>
      </div>
    </Router>
  );
}

export default App;
